import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product detail modal (simulate clicking a product card)
    // We'll use the first product card available
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of product modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Wait for the quantity selector inside the modal
    await page.waitForSelector('#quantity', { timeout: 5000 });

    // Change quantity to 3
    await page.selectOption('#quantity', '3');

    // Take screenshot after changing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_selected.png'));

    // Click "Add to Cart" button in the modal
    // There may be multiple "Add to Cart" buttons, so use the one inside the modal
    const addToCartBtn = await page.$('#productModal .add-to-cart');
    if (!addToCartBtn) throw new Error('Add to Cart button not found in modal');
    await addToCartBtn.click();

    // Wait for the notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Close the modal (simulate clicking the close button)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
    } else {
      // Fallback: click outside modal to close
      await page.click('#productModal', { position: { x: 10, y: 10 } });
    }

    // Open the cart modal by clicking the cart icon/counter
    // Find the cart element (by class "cart" or id "cartCount" parent)
    let cartBtn = await page.$('.cart');
    if (!cartBtn) {
      cartBtn = await page.$('#cartCount');
    }
    if (!cartBtn) throw new Error('Cart button not found');
    await cartBtn.click();

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Wait for at least one cart item to appear
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modal.png'));

    // Extract cart item data to verify quantity update
    const cartItem = await page.$('.cart-item');
    let extractedData = {};
    if (cartItem) {
      const title = await cartItem.$eval('.cart-item-title', el => el.textContent.trim());
      const price = await cartItem.$eval('.cart-item-price', el => el.textContent.trim());
      const quantity = await cartItem.$eval('.cart-item-quantity .quantity', el => el.textContent.trim());
      extractedData = { title, price, quantity };
    }

    return {
      success: true,
      action: "Updated cart item quantity to 3 via product modal and verified in cart",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
